import React, { Component } from 'react';
import axios from 'axios';

import githubtoken from '../config.json';

const GitHub = require('octocat');

class GithubRepos extends Component {
    constructor() {
        super();
        this.state = {
            repos: [],
        }
    }

    componentDidMount() {

// Using an username/password
        const client = new GitHub({
            username: 'walkerfloyd1',
            password: 'GoHeels12345!'
        });

        client.get("/repos/walkerfloyd1/octocat.js")
        .then(response => {
            return response.json()
        })
        .then(data => {
            console.log(data)
        })
        .catch(error => {
            console.error(error)
        })
    }

    render() {
        return (
            <h1> Github Repos will go here</h1>
        )
    }
}

export default GithubRepos;
